ED_DecisionText:
At the 80th plenary meeting, on 9 May 2019, the General Assembly, on the proposal of Uganda,  recalling its resolution 71/318 of 28 August 2017 on the second High-level United Nations Conference on South-South Cooperation, which was held in Buenos Aires from 20 to 22 March 2019, in particular paragraph 13 thereof, on the twentieth session of the High-level Committee on South-South Cooperation, decided:
	(a)	To further postpone the twentieth session of the High-level Committee, which was to be held in 2019, to May 2020;
	(b)	That the twentieth session of the High-level Committee should consist of a one-day organizational meeting and a four-day substantive session.
